self.onInit = function() {
    self.onResize();
    $("#id").change(function () {
        console.log("dropdown change");

        //do csv cleaning 
        //get csv data
        var value="";
        var datasourceData = self.ctx.data[0];
        var dataSet = datasourceData.data;
        for (var d = 0; d < dataSet.length; d++) {
            var tsValuePair = dataSet[d];
            var ts = tsValuePair[0];
            value = tsValuePair[1]; //string
        }

        var s2a = value.split(',');

        //remove first 30 items (header)
        for(var s=0; s<30; s++){
            s2a.shift();
        }

        //remove unneccessary characters such as ["]
        for(var r=0; r<s2a.length;r++){
            if(s2a[r].includes('[')){
                s2a[r] = s2a[r].substring(1);
            }else if(s2a[r].includes(']')){
                s2a[r] = s2a[r].substring(0,s2a[r].length-1);
            }
            if(s2a[r].includes('"')){
                s2a[r] = s2a[r].substring(1);
                s2a[r] = s2a[r].substring(0,s2a[r].length-1);
            }
            if(s2a[r].includes("'")){
                s2a[r] = s2a[r].substring(1);
                s2a[r] = s2a[r].substring(0,s2a[r].length-1);
            }
        }

        //change string to float
        for(var f=0; f<s2a.length;f++){
            s2a[f] = parseFloat(s2a[f]);
        }

        //1d to 2d array
        var x = new Array(s2a.length/30);
        for (var a = 0; a < x.length; a++) {
            x[a] = new Array(30);
        }
        var cumulative = -1;
        for(var i=0; i<s2a.length/30; i++){
            for(var j=0; j<30; j++){
                cumulative = cumulative+1;
                x[i][j] = s2a[cumulative];
            }

        }
        console.log("x",x.length);

        //filter by using id
        var getid = document.getElementById("id");
        var id = getid.value;
        var k=-1;
        var array = [];
        for(var l=0; l<x.length; l++){
            if(x[l][0] == id){
                k = k + 1;
                array[k] = x[l];
            }
        }
        // console.log("array",array);
        self.ctx.deviceService.getDeviceCredentials(self.ctx.datasources[1].entityId).subscribe(function(response) {
            url = "/api/v1/" + response.credentialsId + "/telemetry";
            data = {'inputid': array.toString()};

            $.ajax({
                url: url,
                type: 'post',
                data: JSON.stringify(data),
                headers: {
                    'Content-Type': 'application/json'
                },
                dataType: 'json',
                success: function(postResponse) {
                    console.info("telemetry done. " + postResponse);
                }
            });
        });
    });
}

